//仕様変更　VST対応のため 2002.3.10 sam
//inline
 void Opm::pcmset22(int ndata,float **PcmBuf,bool replace) {

	int	i;

//追加　VSTのバッファポインタとするため　2002.3.10 sam
		PcmBufPtr=0;
	for (i=0; i<ndata; ++i) {
		int	Out[2];
		Out[0] = Out[1] = 0;

			static int rate=0;
//			rate-=62500;
			rate-=OpmRate;
						ExecuteCmnd((unsigned int)i);
			while (rate<0) {
//仕様変更　2002.3.8 sam VSTのサンプリングレートに対応させるため
//				rate+=22050;
//変更 2004.05.23 sam  3.58MHz対応につきrate調整
//				rate+=Samprate;
				rate+=Samprate*2;

//タイマー削除　2002.3.8 sam
//				timer();


//仕様変更　2002.3.12 sam
//				ExecuteCmnd();

				if ((--EnvCounter2) == 0) {
					EnvCounter2 = 3;
					++EnvCounter1;
					int slot;
					for (slot=0; slot<32; ++slot) {
							op[0][slot].Envelope(EnvCounter1);
					}
				}
			}

					{


						int lfopitch;
						int lfolevel;
						int	ch;
						for (ch=0; ch<8; ++ch) {
							 	lfo[ch].Update();
							op[ch][1].inp=op[ch][2].inp=op[ch][3].inp=OpOut[ch]=0;

							lfopitch = lfo[ch].GetPmValue(ch);
							lfolevel = lfo[ch].GetAmValue(ch);

							op[ch][0].Output0(lfopitch, lfolevel);
							op[ch][1].Output(lfopitch, lfolevel);
							op[ch][2].Output(lfopitch, lfolevel);
//仕様変更 全チャンネルでノイズを使用するため　2002.3.18 sam　
//							if (ch!=7) {
//								op[ch][3].Output(lfopitch, lfolevel);
//							}
							op[ch][3].Output32(lfopitch,lfolevel);
						}
//						op[7][3].Output32(lfopitch, lfolevel);
					}


				// InpInpOpm[] に OPM の出力PCMをステレオ加算
//Vol,Panアナログ可変対応　2002.4.7 sam
//各OPに>>が施されるのはオバーフロー対策
				InpInpOpm[0] =	(((OpOut[0]) * pan[0][0])>>5)
								+ (((OpOut[1]) * pan[0][1])>>5)
								+ (((OpOut[2]) * pan[0][2])>>5)
								+ (((OpOut[3]) * pan[0][3])>>5)
								+ (((OpOut[4]) * pan[0][4])>>5)
								+ (((OpOut[5]) * pan[0][5])>>5)
								+ (((OpOut[6]) * pan[0][6])>>5)
								+ (((OpOut[7]) * pan[0][7])>>5);
				InpInpOpm[1] =	(((OpOut[0]) * pan[1][0])>>5)
								+ (((OpOut[1]) * pan[1][1])>>5)
								+ (((OpOut[2]) * pan[1][2])>>5)
								+ (((OpOut[3]) * pan[1][3])>>5)
								+ (((OpOut[4]) * pan[1][4])>>5)
								+ (((OpOut[5]) * pan[1][5])>>5)
								+ (((OpOut[6]) * pan[1][6])>>5)
								+ (((OpOut[7]) * pan[1][7])>>5);
				{

					InpInpOpm[0] = (InpInpOpm[0]&(int)0xFFFFFC00)
									>> ((SIZESINTBL_BITS+PRECISION_BITS)-10-3); // 8*-2^17 〜 8*+2^17
					InpInpOpm[1] = (InpInpOpm[1]&(int)0xFFFFFC00)
									>> ((SIZESINTBL_BITS+PRECISION_BITS)-10-3); // 8*-2^17 〜 8*+2^17
				}
//追加 2007.11.22 sam
//LPFパス機能追加
				if(EnableLPF){
				InpInpOpm[0] += (InpInpOpm[0]<<4)+InpInpOpm[0];	// * 18
				InpInpOpm[1] += (InpInpOpm[1]<<4)+InpInpOpm[1];	// * 18
				InpOpm[0] = (InpInpOpm[0] + InpInpOpm_prev[0]+InpInpOpm_prev[0] + InpInpOpm_prev2[0]
					+ InpOpm_prev[0]+InpOpm_prev[0]+InpOpm_prev[0] - InpOpm_prev2[0]*11) >> 6;
				InpOpm[1] = (InpInpOpm[1] + InpInpOpm_prev[1]+InpInpOpm_prev[1] + InpInpOpm_prev2[1]
					+ InpOpm_prev[1]+InpOpm_prev[1]+InpOpm_prev[1] - InpOpm_prev2[1]*11) >> 6;

				InpInpOpm_prev2[0] = InpInpOpm_prev[0];
				InpInpOpm_prev2[1] = InpInpOpm_prev[1];
				InpInpOpm_prev[0] = InpInpOpm[0];
				InpInpOpm_prev[1] = InpInpOpm[1];
				InpOpm_prev2[0] = InpOpm_prev[0];
				InpOpm_prev2[1] = InpOpm_prev[1];
				InpOpm_prev[0] = InpOpm[0];
				InpOpm_prev[1] = InpOpm[1];
				}else{
					InpOpm[0]=InpInpOpm[0];
					InpOpm[1]=InpInpOpm[1];
				}
//			}

			// 全体の音量を調整
			//OutOpm[0] = (InpOpm[0]*TotalVolume) >> 8;
			//OutOpm[1] = (InpOpm[1]*TotalVolume) >> 8;
//修正 2007.11.22 sam
//音量バイアス機能追加 左シフト数を可変に5:0dB 0:+30dB
						 Out[0] = InpOpm[0]>>Bias;
						 Out[1] = InpOpm[1]>>Bias;
			//Out[0] -= OutOpm[0]>>(5);	// -4096 〜 +4096
			//Out[1] -= OutOpm[1]>>(5);






		// 音割れ防止
		if ((unsigned int)(Out[0]+32767) > (unsigned int)(32767*2)) {
			if ((int)(Out[0]+32767) >= (int)(32767*2)) {
#ifdef DEBUG
               DebugPrint ("Out[0] Overflow=%d",Out[0]);
#endif
				Out[0] = 32767;

			} else {
				Out[0] = -32767;
#ifdef DEBUG
               DebugPrint ("Out[0] Underflow=%d",Out[0]);
#endif
			}
		}
		if ((unsigned int)(Out[1]+32767) > (unsigned int)(32767*2)) {
			if ((int)(Out[1]+32767) >= (int)(32767*2)) {
#ifdef DEBUG
               DebugPrint ("Out[1] Overflow=%d",Out[1]);
#endif
				Out[1] = 32767;
			} else {
#ifdef DEBUG
               DebugPrint ("Out[1] Underflow=%d",Out[1]);
#endif
				Out[1] = -32767;
			}
		}
//変更　VSTバッファ仕様に合わせる。　2002.3.12 sam
		//PcmBuf[0][PcmBufPtr] = Out[0];
		//PcmBuf[1][PcmBufPtr] = Out[1];
				if(replace==true){
					PcmBuf[0][PcmBufPtr] = ((float)Out[0])/32767.0f;
					PcmBuf[1][PcmBufPtr] = ((float)Out[1])/32767.0f;
				}else{
					PcmBuf[0][PcmBufPtr]+= ((float)Out[0])/32767.0f;
					PcmBuf[1][PcmBufPtr]+= ((float)Out[1])/32767.0f;
				}
		++PcmBufPtr;
//		if (PcmBufPtr >= PcmBufSize) {
//			PcmBufPtr = 0;
//		}
		}
}

