int Opm::SetOpmClock(int clock) {
//	int rate = clock >> 6;
//変更 3.58MHz対応のため 2007.11.22 sam
	int rate = clock>>5;
	if (rate <= 0) {
	  //		return X68SNDERR_BADARG;
				return(-1);
	}
	if (Dousa_mode == 0) {
		OpmRate = rate;
		return 0;
	}
	int dousa_mode_bak = Dousa_mode;

	Free();
	
	OpmRate = rate;
	MakeTable();
	ResetSamprate();

	Dousa_mode = dousa_mode_bak;
	//return WaveAndTimerStart();
		return(0);
}



